        <div>
          <h2>Category</h2>
          <ul className="category">
            <li className="category_list">
              <a href="#">All</a>
              <a href="#">Mobile</a>
              <a href="">Laptop</a>
              <a href="">Computer</a>
              <a href="">Accessories</a>
              <a href="">Watch</a>
            </li>
          </ul>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.section`
`;
export default Category;
